import { Wrapper, Title, Menu, SearchInput, Form, SearchIcon, DeleteIcon, ThemeBtn } from './styleComps';
import TagLink from '../TagLink';

import homeIcon from '../../icons/home.svg';
import blogIcon from '../../icons/blog.svg';
import archiveIcon from '../../icons/archive.svg';
import aboutIcon from '../../icons/about.svg';
import searchIcon from '../../icons/search.svg';
import deleteIcon from '../../icons/delete.svg';

function Nav() {
    return (
        <Wrapper>
            <Title>My Blog App</Title>
            <Menu>
                <TagLink icon={homeIcon} link="/">Home</TagLink>
                <TagLink icon={blogIcon} link="/">Blog</TagLink>
                <TagLink icon={archiveIcon} link="/">Archive</TagLink>
                <TagLink icon={aboutIcon} link="/">About</TagLink>
                <Form>
                    <SearchInput placeholder="Search here..." />
                    <SearchIcon backgroundImage={searchIcon} />
                    <DeleteIcon backgroundImage={deleteIcon} />
                </Form>
                <ThemeBtn/>
            </Menu>
        </Wrapper>
    )
}

export default Nav;
